export const CardContext = createContext();

function Card(props){

    const [card, setCard] = useState(
        {title:'testing it out'}
    )

    console.log(card)
    return(
        <div>
            <CardContext.Provider value={card}>
                {props.children}
            </CardContext.Provider>
        </div>

    )
}

